import React from 'react';
import {
  Button,
  Card,
  CardActions,
  CardContent,
  CardMedia,
  Typography,
} from '@material-ui/core';

const Event = props => {
  return (
    <div>
      {props.events && (
        <Card>
          <CardMedia
            style={{ height: 0, paddingTop: '50' }}
            image={props.course.fields.course}
            title={props.course.fields.title}
          />
        </Card>
      )}
    </div>
  );
};

export default Event;
